import { Link } from 'react-router-dom'
import Nav from './Nav'

const Manage = () => {
    return (
        <div>
            <h1>Manage</h1>
            <Nav />
            <Link to='/'><button>Login</button></Link>
            <Link to='/menu'><button>Menu</button></Link>
        </div>
    )
}

export default Manage
